	add("agnes", "{\"term\":\"agnes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|ἁγνός||pure, chaste}}, {{m|grc|ἁγνεία||purity, chastity}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027 Annie Howells Fréchette, \u0027Reuben Dale\u0027, Galaxy, W.C. and F.P.Church, 1876, page 39\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Why do you call Mrs. Stone Aggie? \u0027\u0027Agnes\u0027\u0027 is such a beautiful name, it is a shame to nick it in that way.\u0026quot; Then, quickly regretting his impatience, he added, \u0026quot;You would not have been jealous, would you, Jenny?\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027 w:Colleen Colleen McCullough, \u0027The Thorn Birds\u0027, Gramercy Books 1998, ISBN 0517201658, pages 3\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Right then and there in her mind she had christened it \u0027\u0027Agnes\u0027\u0027, the only name she knew elegant enough for such a peerless creature. - - - She held the doll so her brothers could see. \u0026quot;Look, isn\u0027t she beautiful? Her name is \u0027\u0027Agnes\u0027\u0027.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Agnes? \u0027Agnes?\u0027\u0027\u0027\u0026quot; Jack gagged realistically. \u0026quot;What a soppy name! Why don\u0027t you call her Margaret or Betty?\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 Elizabeth Wurtzel: \u0027Prozac Nation: Young and Depressed in America\u0027, Riverhead Books, 1995, ISBN 1573225126, page 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I found myself wanting to explain it to her, this middle-aged woman with the kind of haircut you call a hairdo, which needed to be set in rollers every night, who had a name like \u0027\u0027Agnes\u0027\u0027 or Harriet, a name that even predated my mother\u0027s generation\", \"priority\":7}]}, \"synonyms\":{}}");

	add("agnosia", "{\"term\":\"agnosia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀγνωσία\u0027 (ignorance)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The inability to recognize objects by use of the senses\", \"priority\":1}]}, \"synonyms\":{}}");

	add("agnosis", "{\"term\":\"agnosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027ἀ-|sc\u003dpolytonic\u0027 (without”, “lacking) + \u0027γνῶσις|sc\u003dpolytonic\u0027 (knowledge) ≅ \u0027ignorance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Epistemologically necessary lack of, indifference to, denial or shunning of, or defective knowledge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027: \u0027The American Journal of Surgery\u0027, volume 29, [http://books.google.co.uk/books?id\u003dXj0TAAAAYAAJ\u0026amp;dq\u003dagnosis\u0026amp;lr\u003d page 379]\u0026lt;sup\u0026gt;{1} \u0026amp; {2}\u0026lt;/sup\u0026gt; (Paul B. Hoeber\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; And finally, we come to the \u0027\u0027agnosis\u0027\u0027, the most important of them all\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; I do not refer to the \u0027\u0027agnosis\u0027\u0027 or the ignorance of cancer in general\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1934\u0027\u0027: the New York Neurological Association, the Philadelphia Neurological Society, and the Boston Society of Psychiatry and Neurology, \u0027Journal of Nervous and Mental Disease\u0027, volume 80, [http://books.google.co.uk/books?id\u003dt5AsAAAAIAAJ\u0026amp;q\u003dagnosis\u0026amp;dq\u003dagnosis\u0026amp;lr\u003d\u0026amp;pgis\u003d1 page 648\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"For instance he cannot tell the time on the clock, since that depends on the relation of the direction of the hands to each other. This inability to differentiate the directions in relation to each other is a possible cause of optical \u0027\u0027agnosis\u0027\u0027. There is a direction element in the form of every object\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027: Samuel Brock and Howard P. Krieger, \u0027The Basis of Clinical Neurology: The Anatomy and Physiology of the Nervous System in Their Application to Clinical Neurology\u0027, fourth edition, [http://books.google.co.uk/books?lr\u003d\u0026amp;id\u003dQQa0AAAAIAAJ\u0026amp;dq\u003dagnosis\u0026amp;q\u003d%22unilateral+spatial+agnosis%22\u0026amp;pgis\u003d1 page 308] (Williams \u0026amp; Wilkins\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"They point out that unilateral spatial \u0027\u0027agnosis\u0027\u0027 is not the sole cause of the disability, and that some degree of bilateral cerebral involvement may be an\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Paul J. Griffiths and Reinhard Hütter, \u0027Reason and the Reasons of Faith\u0027, [http://books.google.co.uk/books?id\u003dH_6dQDJJsUUC\u0026amp;pg\u003dPA331\u0026amp;dq\u003dagnosis\u0026amp;lr\u003d page 331] ([http://www.continuumbooks.com/Books/detail.aspx?ImprintID\u003d2\u0026amp;CountryID\u003d2\u0026amp;BookId\u003d121814 Continuum International Publishing Group]; ISBN 0567028305, 9780567028303\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The situation of the person who denies that metaphysical objectivity that is essential to the very idea of truth is not only one of self-contradiction, but of permanent \u0027\u0027agnosis\", \"priority\":10}]}, \"synonyms\":{}}");

	add("agnostic", "{\"term\":\"agnostic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"First attested in 1870; coined by w:Thomas Huxley|Thomas Huxley. Either from Ancient greek (to 1453) \u0027ἄγνωστος\u0027 (ignorant, not knowing) or from \u0027a-\u0027 + \u0027Gnostic\u0027. Deriving (either way) from Ancient greek (to 1453) \u0027ἀ-\u0027 (not) + \u0027γιγνώσκω\u0027 (i know)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who holds to a form of agnosticism, especially uncertainty of the existence of a deity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;!--reprinted in \u0026quot;An Agnostic\u0027s Apology\u0026quot; (1893), New York: G. P. Putnam\u0027s Sons, p. 268--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("agnosticism", "{\"term\":\"agnosticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Thomas Huxley|Thomas Huxley. From {{confix|a|gnostic|ism|lang\u003den}} (see also agnostic).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The view that absolute truth or ultimate certainty is unattainable, especially regarding knowledge not based on experience or perceivable phenomena\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The view that the existence of God or of all deities is unknown, unknowable, unproven, or unprovable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Doubt, uncertainty, or scepticism regarding the existence of a god or gods\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;b\u0026gt;1956, \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;January 31\u0026lt;sup\u0026gt;st\u0026lt;/sup\u0026gt;\u0026lt;/span\u0026gt;\u0026lt;/b\u0026gt;: w:A. A. Alan Alexander Milne; quoted in\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027: James B. Simpson, \u0027Simpson’s Contemporary Quotations\u0027, [http://www.bartleby.com/63/93/4393.html № 4,393] (w:Houghton Houghton Mifflin, ISBN 0395430852\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Old Testament is responsible for more atheism, \u0027\u0027agnosticism\u0027\u0027, disbelief — call it what you will — than any book ever written; it has emptied more churches than all the counterattractions of cinema, motor bicycle and golf course\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Doubt, uncertainty, or scepticism regarding any subject of dispute\", \"priority\":7}]}, \"synonyms\":{}}");

	add("agnotology", "{\"term\":\"agnotology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Robert N. Proctor|Robert N. Proctor\u0026lt;ref\u0026gt;{{cite news|url\u003dhttp://www.nytimes.com/2006/08/22/business/22mistakes.html?ex\u003d1313899200\u0026amp;en\u003de687ef6c5786717f\u0026amp;ei\u003d5088\u0026amp;partner\u003drssnyt\u0026amp;emc\u003drss|title\u003dWhat Organizations Don\u0027t Want to Know Can Hurt|author\u003dArenson, Karen W.|work\u003dNew York Times|date\u003d2006-08-22}}\u0026lt;/ref\u0026gt;, deriving from the Neoclassical Greek word \u0027ἄγνωσις\u0027 (not knowing) compare \u0027ἄγνωτος\u0027 and \u0027-λογία\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of culturally-induced ignorance or doubt, particularly the publication of inaccurate or misleading scientific data\", \"priority\":1}]}, \"synonyms\":{}}");

